import React from "react";
import "./Logo.css";

const Logo = () => {
  return (
    <div className="logo">
      <img
        width="50px"
        src="https://image.ibb.co/fujxD0/mylogo2.png"
        alt="JM"
      />
    </div>
  );
};

export default Logo;
